measurements.description:
Eighteen flowers on four upright 14.5-cm inflorescences;
	sepals and petals dark green fully flushed red-bronze, speckled dark purple, more concentrated distally, petals very slightly ruffled;
	 lip white, midlobe bright fucshia;
	 column white, lightly flushed fuchsia, anther cap white;

    substance firm; texture glossy, lip diamond dust; commended for improvement in color and lip.
